        // mgrs_struct_by_html = {"name1":{"ip":"ip", "port":"port",...},"name2":{...}}
        let mgrs_struct_by_html = window['MGRS'];
        let mgrs_names = [];
        for (let u in mgrs_struct_by_html) {
            mgrs_names.push(u);
            //забираем состояния Менеджеров в локальную Структуру
            if (typeof max_data_structure.mgrs[u] === "undefined"){
                max_data_structure.mgrs[u] = {};
                max_data_structure.mgrs[u]["state"] = mgrs_struct_by_html[u]["state"];
            }
        }
        //--------------------------------
        //console.log("hh =", hh); //64
