	function main_global_mouse_up(namespace, sensitivity, timestamp, cooldown)
	{

		var dx = Math.abs(window[namespace+"_xd"] - window[namespace+"_xu"]);
		var dy = Math.abs(window[namespace+"_yd"] - window[namespace+"_yu"]);
		var dt = Math.abs(window[namespace+"_last_ms"] - timestamp);
		
		if(dx < sensitivity && dy < sensitivity && dt > cooldown)
		{
			if(typeof window[namespace+"_btnid"] !== 'undefined')
			{
				if(window[namespace+"_btnid"] != "")
				{
					
					var this_id_decode = window[namespace+"_btnid"].split("-");
					var custom_function = this_id_decode[1];
					
					if(typeof custom_function !== 'undefined')
					{
						if(typeof window[custom_function] !== 'undefined')
						{
							if(typeof window[custom_function] == 'function')
							{								
								var milliseconds = (new Date).getTime();
								window[custom_function](window[namespace+"_btnid"]);
							}
						}
						else
						{
							alert ("couldn't find : "+ custom_function);
						}
					}
				}
			}
			else
			{
				//alert(namespace+"_btnid is ... alas.. undefined");
			}
			
			window[namespace+"_last_ms"] = timestamp;
		}
		
		window[namespace+"_btnid"] = "";
	}


