	function lmmk3_recursive_width_parser(target_width, size_data, priority_data, priority_level, recursion_id)
	{
		// if priority_level is not defined, assume this is the first run.
		if(typeof recursion_id === 'undefined')
		{
			recursion_id = 0;
		}

		var highest_priority_level = 0;
		if(typeof priority_level === 'undefined')
		{
			//console.log("this is the first run");
			
			for(var i = 0; i<priority_data.length; i++)
			{
				//console.log(priority_data[i]);
				if(highest_priority_level < priority_data[i])
				{
                    //console.log('highest_priority_level < priority_data[i]');
					highest_priority_level = priority_data[i];
				}
			}
			priority_level = highest_priority_level;
		}
		else
		{
			//find next priority level in data.
			//console.log("this is a subsequent run, old_priority is : " + priority_level);
			
			for(var i = 0; i<priority_data.length; i++)
			{
				//console.log(priority_data[i]);
				if(highest_priority_level < priority_data[i] && priority_data[i] < priority_level)
				{
                    //console.log(" priority level is : "+ priority_level);
					highest_priority_level = priority_data[i];
				}
			}
			priority_level = highest_priority_level;
		}
		
		//console.log(recursion_id +" priority level is : "+ highest_priority_level);
		
		var min_width = 0;
		for(var i = 0; i<size_data.length; i++)
		{
			if(priority_data[i] <= highest_priority_level)
			{
				min_width = min_width + size_data[i][0];
			}
		}
		
		//console.log("min_width: "+ min_width);
		//console.log("target_width: "+ target_width);
		if(min_width <= target_width)
		{
			//console.log("we are done");
			return highest_priority_level;
		}
		else
		{
			recursion_id = recursion_id + 1;
			return lmmk3_recursive_width_parser(target_width, size_data, priority_data, priority_level, recursion_id);
		}
	}

