	function r_validate_form(data_pointer)
	{
		var input_array = window[data_pointer]["inputs"];
		
		var number_of_items_capable_of_being_validated = 0;
		var number_of_items_that_are_valid = 0;
		
		for(var index in input_array)
		{
			//console.log('checking index: ' + index);
			
			var is_valid;
			if(typeof input_array[index]["valfu"] !== 'undefined')
			{
				//console.log("has valfu");
				number_of_items_capable_of_being_validated = number_of_items_capable_of_being_validated + 1;
				var this_valfu_arr = function_cleanser(input_array[index]["valfu"]);
				//console.log(this_valfu_arr);
				is_valid = false; //presume false unless otherwise specified.
				if(typeof input_array[index]["val"] === 'undefined')
				{
					// has valfu, but no val... false by default
					is_valid = false;
				}
				else
				{
					var is_valid_list = [];
					for(var i = 0; i<this_valfu_arr.length; i++)
					{
						if(typeof window[this_valfu_arr[i]] === 'function')
						{
							//console.log("       calling: " + this_valfu_arr[i]);
							var _this_valid = window[this_valfu_arr[i]](input_array[index]["val"]);
							//console.log("       _this_valid: "+ _this_valid);
							is_valid_list.push(_this_valid);
						}
					}
					
					//console.log(is_valid_list);
					var is_valid_counter = 0;
					for(var i = 0; i < is_valid_list.length; i++)
					{
						if(is_valid_list[i] == true)
						{
							is_valid_counter = is_valid_counter + 1;
						}
					}
					
					if(is_valid_counter == is_valid_list.length)
					{
						is_valid = true;
					}
				}
				
				//console.log("found is_valid: "+ is_valid);
				window[data_pointer]["inputs"][index]["is_valid"] = is_valid;

				var this_object_dom_id = window[data_pointer]["inputs"][index]["dom_id"];
				
				//console.log("updating this id: "+ this_object_dom_id);
				
				if(is_valid == false)
				{
					$("#"+ this_object_dom_id).css("backgroundColor", "#ffdbdb");
				}
				else if(is_valid == true)
				{
					$("#"+ this_object_dom_id).css("backgroundColor", on_color);
					number_of_items_that_are_valid = number_of_items_that_are_valid + 1;
				}
			}
		}
		
		
		//console.log(number_of_items_capable_of_being_validated +", "+ number_of_items_that_are_valid);
		if(number_of_items_capable_of_being_validated == number_of_items_that_are_valid)
		{
			//console.log("");
			//console.log(" FORM IS VALID ");
			$("#" + "modal_ftr_render-set_to_render-" + data_pointer).css("backgroundColor", on_color);
			window[data_pointer]["everything_is_valid"] = 1;
		}
		else
		{
			//console.log("");
			//console.log(" FORM IS >>>>>>>> NOT <<<<<<<< VALID ");
			$("#" + "modal_ftr_render-set_to_render-" + data_pointer).css("backgroundColor", "#ffffff");
			window[data_pointer]["everything_is_valid"] = 0;
		}
	}
	
	function draw_modal_div_contents(mw, mh, data_pointer)
