		var f_max = 100;
		
		var hh = mh * h_percent;if(hh > h_max){hh = h_max;};if(hh < h_min){hh = h_min;};
		var fh = mh * f_percent;if(fh > f_max){fh = f_max;};if(fh < f_min){fh = f_min;};
		// var bh = mh - hh - fh;
		var bh = mh - hh - fh - 6;
		
		
