		// header;
		a += "<div style = 'width:"+mw+"px; height:"+hh+"px; box-shadow: 0 4px 2px -2px #dddddd; overflow:hidden;'>";
			a += "<div style = 'position:absolute; line-height:"+hh+"px; margin-left:"+15+"px;' >"+max_name+"</div>"
			a += "<div class = '"+"render_btn"+"'  id = '"+"modal_hdr_close-render_modal_close"+"' style = 'position:absolute; cursor:pointer; width:"+hh+"px; height:"+hh+"px;line-height:"+hh+"px; margin-left:"+parseInt(mw - hh)+"px; text-align:center;font-size:24px;' > X </div>"
