		//body
		// a += "<div  id = 'render_modal_body_outer' style = 'position:relative; width:"+mw+"px; height:"+bh+"px; overflow:hidden;'>";
		a += "<div  id = 'render_modal_body_outer' style = 'position:relative; width:"+mw+"px; height:"+bh+"px; overflow:hidden;margin-top: 3px;margin-bottom: 3px;'>";
			a +=  draw_body_contents(mw, bh, data_pointer)
		a += "</div>";
		
		
		//footer
		
		var rbh = fh * 0.9;
		var rbw = rbh * 2;
		var border_width = 1;
		var render_button_pad = (fh - (rbh + border_width * 2)) / 2 
		var rbl = mw - (rbw + border_width * 2) - render_button_pad;
		var rbt = render_button_pad
		
		
		a += "<div style = 'width:"+mw+"px; height:"+fh+"px; box-shadow: 0 -4px 2px -2px #dddddd; overflow:hidden;'>";
			a += "<div class = '"+"render_btn"+"'  id = '"+"modal_ftr_render-set_to_render"+"-"+data_pointer+"' style = 'position:absolute; cursor:pointer; width:"+rbw+"px; height:"+rbh+"px;line-height:"+rbh+"px; margin-left:"+rbl+"px; margin-top:"+rbt+"px; text-align:center; border:"+border_width+"px solid #666666; border-radius:3px;' > Render </div>"
		a += "</div>";
		
		
		return a;		
