	function fw_text_render_2x(bw, data_pointer, current_input_id, next_input_id)
	{
		var this_input_arr =  window[data_pointer]["inputs"][current_input_id];
		var next_input_arr =  window[data_pointer]["inputs"][next_input_id];
		
		var this_input_description = this_input_arr["description"];
		var next_input_description = next_input_arr["description"];
		
		// math.
		var button_size = bw / 2 - bw / (2 * 2.5);if(button_size > 120){button_size = 120;};
		button_size  = button_size + 2;  // borders;
		
		var margin_width = (bw - 2*button_size) / 4;
		var center_margin_width = margin_width / 2;
		var input_width = margin_width + button_size - center_margin_width/2;
		
		var second_mleft = margin_width + input_width + center_margin_width;
		
		var a = "";
		
		a += "<div style = 'height:51px;'>";
				a += "<div style = 'position:absolute; margin-left:"+margin_width+"px; width:"+input_width+"px; '>";
					a += "<div style = 'height:"+15+"px;'>"+this_input_description+"</div>";
					a += return_input_string(data_pointer, current_input_id, input_width);
				a += "</div>";
				
				a += "<div style = 'position:absolute; margin-left:"+second_mleft+"px; width:"+input_width+"px; '>";
					a += "<div style = 'height:"+15+"px;'>"+next_input_description+"</div>";
					a += return_input_string(data_pointer, next_input_id, input_width);
				a += "</div>";
		a += "</div>";
		
		return a;
	}
	
