	function return_input_string(data_pointer, current_input_id, input_width)
	{
		var this_input_arr =  window[data_pointer]["inputs"][current_input_id];
		var this_input_id = "r_input-"+data_pointer+"-"+current_input_id;
		
		var placeh_str = "";
		if(typeof this_input_arr["placeholder"] !== 'undefined'){placeh_str = "placeholder='"+this_input_arr["placeholder"]+"'";}
		
		var type_str = "";
		if(typeof this_input_arr["type"] !== "undefined"){type_str = "type='"+this_input_arr["type"]+"'";}else{type_str = "type='text'";}
		
		var val_str = "";
		if(typeof this_input_arr["val"] !== 'undefined')
		{
			if(typeof this_input_arr["val"] == 'string' || typeof this_input_arr["val"] == 'String')
			{
				val_str = "value = '"+this_input_arr["val"].replace(/'/,"&#39;")+"'";
			}
			else
			{
				val_str = "value = '"+this_input_arr["val"]+"'";
			}			
		}
		
		var restrict_funcs = function_cleanser(this_input_arr["restrict"]);		
		var rf_call = "";
		if(restrict_funcs != undefined)
		{
			rf_call = "onkeypress='return restrict_verification(this, event);'";
		}
		
		var max_length_str = "";
		if(typeof this_input_arr["max_length"] !== 'undefined')
		{
			max_length_str = "maxlength='"+this_input_arr["max_length"]+"' " ;
		}
		
		window[data_pointer]["inputs"][current_input_id]["dom_id"] = this_input_id;
		
		var a = "<input class = 'render_input' id = '"+this_input_id+"' style = 'background-color:"+on_color+"; width:"+parseInt(input_width - 4)+"px; height:"+30+"px;' "+placeh_str+" "+type_str+" "+val_str+" "+rf_call+" "+max_length_str+" '>";
		return a;
	}
	
