	function restrict_verification(t,e)
	{
		var is_true = true;
		var this_obj_id_decode = $(t).attr('id').split("-");
		var data_pointer = this_obj_id_decode[1];
		var input_index  = this_obj_id_decode[2]; 
		
		var this_input_data = window[data_pointer]["inputs"][input_index];

		var restrict_funcs = this_input_data["restrict"];
		
		if(typeof restrict_funcs !== 'undefined')
		{
			for(var i = 0; i<restrict_funcs.length; i++)
			{
				if(typeof window[restrict_funcs[i]] == 'function')
				{
					var this_restrict = window[restrict_funcs[i]]();
					var this_check = restrict_check(t, e, this_restrict);
					if(this_check == false)
					{
						is_true = false;
					}
				}
			}
		}
		
		if(is_true == true)
		{
			return true;
		}
		else
		{
			return false;
		}
	}
	// obj=html-element, e=event, this_restrict=/regular expression/
	function restrict_check(obj, e, this_restrict) 
	{
		if(!e)
		{
			var e = window.event
		}
		if(e.keyCode)
		{
			code = e.keyCode;
		}
		else if(e.which)
		{
			code = e.which;
		}

		var character = String.fromCharCode(code);

		if(character.match(this_restrict)) 
		{
			return true;
		}
		else 
		{
			return false;
		}
	}
	
