	function render_bind(namespace)
	{
        
		var use_touch = 0;
		var use_mouse = 0;
		if(BrowserDetect.OS == 'Windows'||BrowserDetect.OS == 'Linux'||BrowserDetect.OS == 'Mac')
		{
			try 
			{  
				use_touch = 1;
				document.createEvent("TouchEvent");				
			}
			catch(e) 
			{
				use_touch = 0;
			}
			use_mouse = 1;			
		}
		else
		{
			use_touch = 1;
		}

		
		$("."+namespace+"_input").unbind();
		$("."+namespace+"_input").bind("keyup", function(e)
		{
			var this_id = $(this).attr("id");
			var this_id_decode = this_id.split("-");

			var this_prefix = this_id_decode[0];
			var data_pointer = this_id_decode[1];
			var current_input_id = this_id_decode[2];
			
			//console.log($(this).val());
			
			window[data_pointer]["inputs"][current_input_id]["val"] = $(this).val();
			r_validate_form(data_pointer)
		});
		
		$("."+namespace+"_btn").unbind();
		window[namespace+"_last_ms"] = (new Date).getTime();
		if(use_mouse == 1)
		{
			$("."+namespace+"_btn").bind("mousedown", function(e)
			{
				window[namespace+"_btnid"] = $(this).attr("id");
			});
			if(window[namespace+"_mouse_bound"] != 1)
			{
				$(document).bind("mousedown", function(e)
				{
					window[namespace+"_xd"] = e.pageX;
					window[namespace+"_xu"] = e.pageX;
					window[namespace+"_yd"] = e.pageY;
					window[namespace+"_yu"] = e.pageY;
				});
				
				$(document).bind("mousemove", function(e)
				{
					window[namespace+"_xu"] = e.pageX;
					window[namespace+"_yu"] = e.pageY;
				});
				
				$(document).bind("mouseup", function(e)
				{                
					if(typeof window[namespace+"_global_mouse_up"] == 'function')
					{
						window[namespace+"_global_mouse_up"](namespace, 20, (new Date).getTime(), 30);
					}
					else
					{
						alert(namespace+"_global_mouse_up is not a function");
					}
				});
				window[namespace+"_mouse_bound"] = 1;
			}
		}
		
		if(use_touch == 1)
		{
			$("."+namespace+"_btn").bind("touchstart", function(e)
			{
				window[namespace+"_btnid"] = $(this).attr("id");
			});

			if(window[namespace+"_touch_bound"] != 1)
			{
				$(document).bind("touchstart", function(e)
				{
					window[namespace+"_xd"] = e.originalEvent.touches[0].pageX;
					window[namespace+"_xu"] = e.originalEvent.touches[0].pageX;
					window[namespace+"_yd"] = e.originalEvent.touches[0].pageY;
					window[namespace+"_yu"] = e.originalEvent.touches[0].pageY;
				});
				
				$(document).bind("touchmove", function(e)
				{
					window[namespace+"_xu"] = e.originalEvent.touches[0].pageX;
					window[namespace+"_yu"] = e.originalEvent.touches[0].pageY;
				});
				
				$(document).bind("touchend", function(e)
				{
					if(typeof window[namespace+"_global_mouse_up"] == 'function')
					{
						window[namespace+"_global_mouse_up"](namespace, 40, (new Date).getTime(), 30);
					}
					else
					{
						alert(namespace+"_global_mouse_up is not a function ");
					}
				});
				window[namespace+"_touch_bound"] = 1;
			}
		}
	}
	
	function render_global_mouse_up(namespace, sensitivity, timestamp, cooldown)
	{
		var dx = Math.abs(window[namespace+"_xd"] - window[namespace+"_xu"]);
		var dy = Math.abs(window[namespace+"_yd"] - window[namespace+"_yu"]);
		var dt = Math.abs(window[namespace+"_last_ms"] - timestamp);
		
		if(dx < sensitivity && dy < sensitivity && dt > cooldown)
		{
			if(typeof window[namespace+"_btnid"] !== 'undefined')
			{
				if(window[namespace+"_btnid"] != "")
				{
					
					var this_id_decode = window[namespace+"_btnid"].split("-");
					var custom_function = this_id_decode[1];
                    //console.log("custom_function="+custom_function);
					if(typeof custom_function !== 'undefined')
					{
						if(typeof window[custom_function] !== 'undefined')
						{
							if(typeof window[custom_function] == 'function')
							{								
								var milliseconds = (new Date).getTime();
								window[custom_function](window[namespace+"_btnid"]);
							}
						}
						else
						{
							alert ("couldn't find : "+ custom_function);
						}
					}
					
				}
			}
			else
			{
				//alert(namespace+"_btnid is ... alas.. undefined");
			}
			
			window[namespace+"_last_ms"] = timestamp;
		}
		
		window[namespace+"_btnid"] = "";
	}
	
