	function val_is_valid_frame_sequence(value)
	{
		// first option, we have an intiger
		if(parseInt(value) == value)
        {
            return true;
		}
        else
        {
			// if it is not just a number we have a few options
			// the first thing we need to do is to split everything by comma.
			var number_or_number_pair_array = value.split(",");
			var content_array = [];
			var validation_array = [];
			// the next thing we have to do is to verify that each number pair is a valid number pair.
			for(var i = 0; i<number_or_number_pair_array.length; i++)
            {
				// first check if this is a number and it is a valid number
				if(parseInt(number_or_number_pair_array[i]) == number_or_number_pair_array[i])
                {
					//it is a valid number
					validation_array.push(true);
					content_array.push(parseInt(number_or_number_pair_array[i]));
				}
                else
                {
					//this has to be a valid number pair
					var this_number_pair = number_or_number_pair_array[i].split("-");
					this_number_pair[0] = parseInt(this_number_pair[0]);
					this_number_pair[1] = parseInt(this_number_pair[1]);
					if(this_number_pair.length == 2)
                    {
						// we check that the first number is bigger than the second number
						if(this_number_pair[0] < this_number_pair[1])
                        {
							validation_array.push(true);
							content_array.push([parseInt(this_number_pair[0]),parseInt(this_number_pair[1])])
						}
					}
				}
			}
			
			
			if(validation_array.length == number_or_number_pair_array.length)
            {
				// ok, so we didnt fail on any of the checks, now we have to test for collisions 
				for(var i = 0; i<content_array.length; i++)
                {
					var exterior_lower_bound = -1;
					var exterior_upper_bound = -1;
					if(typeof content_array[i] == 'number')
                    {
						exterior_lower_bound = content_array[i]
					}
                    else if(typeof content_array[i] == 'object')
                    {
						exterior_lower_bound = content_array[i][0];
						exterior_upper_bound = content_array[i][1];
					}
					for(var j = 0; j<content_array.length; j++)
                    {
						if(i != j) // shouldn't be comparing myself to myself.
                        {
							var interior_lower_bound = -1;
							var interior_upper_bound = -1;
							if(typeof content_array[j] == 'number')
                            {
								interior_lower_bound = content_array[j];
							}
                            else if(typeof content_array[j] == 'object')
                            {
								interior_lower_bound = content_array[j][0];
								interior_upper_bound = content_array[j][1];
							}
							if(exterior_upper_bound == -1)
                            {
								// outer is a number
								if(interior_upper_bound == -1)
                                {
									if(exterior_lower_bound == interior_lower_bound)
                                    {
										validation_array[i] = false;
										j = content_array.length;
										i = content_array.length;
									}
								}
                                else
                                {
									if(exterior_lower_bound >= interior_lower_bound && exterior_lower_bound <= interior_upper_bound)
                                    {
										// this is bad
										validation_array[i] = false;
										j = content_array.length;
										i = content_array.length;
									}
								}
							}
                            else
                            {
								//outer is a range
								if(interior_upper_bound == -1)
                                {
									if(interior_lower_bound >= exterior_lower_bound && interior_lower_bound <= exterior_upper_bound)
                                    {
										// this is bad
										validation_array[i] = false;
										j = content_array.length;
										i = content_array.length;
									}
								}
                                else
                                {
									if(exterior_lower_bound >= interior_lower_bound && exterior_lower_bound <= interior_upper_bound)
                                    {
										// this is bad
										validation_array[i] = false;
										j = content_array.length;
										i = content_array.length;
									}
									if(exterior_upper_bound >= interior_lower_bound && exterior_upper_bound <= interior_upper_bound)
                                    {
										// this is bad
										validation_array[i] = false;
										j = content_array.length;
										i = content_array.length;
									}
								}
							}
						}
					}
				}
				
				
				var is_true = true;
				for(var i = 0; i<validation_array.length; i++)
				{
					if(validation_array[i] == false)
					{
						is_true = false;
						i = validation_array.length;
					}
				}
				
				if(is_true == true)
				{
					return true;
				}
			}
		}
		return false
	}
	
