	function add_some_zero(tf_len, frames_counter)
	{

		var cur_frame_in_str = "";
		//        console.log("add_some_zero: tf_len = "+tf_len, ", frames_counter = "+frames_counter);
		var zero_count = (tf_len - frames_counter.toString().length);

		if (zero_count > 0)
		{
			for(var i=0; i<zero_count; i++)
			{
				cur_frame_in_str += "0";
			}
		}
		cur_frame_in_str += frames_counter.toString();
		return cur_frame_in_str;
	}

