    //Самодельный Alert ! msg - текст сообщения!
    function modal_info_constructor(msg)
	{
			max_data_structure.draw_info = 1;
			max_data_structure.info_msg = msg;
			var ww = $(window).width();
			var wh = $(window).height();

			let modal_w = 320;
			let modal_h = 170;
			let info_btn_ok_h = 24;
			let info_btn_ok_w = 130;
			let info_block_ok = 40;

			let a = "";

			var background_layer_id = "info_bkg-info_modal_close";
			var modal_div_id = "info_modal_text";

			var mh_min = modal_w;
			var mw_min = modal_h;

			var ml = ww/2 - modal_w/2;
			var mt = wh/2 - modal_h/2;

			$("#"+ background_layer_id).remove();
			$("#"+ modal_div_id).remove();

			//draw background
			a += "<div class = '"+"render_btn"+"' id = '"+background_layer_id+"' style = 'position:absolute; width:"+ww+"px; height:"+wh+"px; opacity:0;left:0px;top:0px;'>";
				a += "<img style = 'opacity:0;position:absolute; width:"+ww+"px; height:"+wh+"px;' src = '"+grey_pixel+"'/>";
			a += "</div>";
			//Info block
			a += "<div id = '"+modal_div_id+"' style = 'text-align:center;font-family:arial; color:#666666; font-weight:bold; font-size:13px; opacity:0; top:"+mt+"px; left:"+ml+"px; position:absolute; width:"+modal_w+"px; height:"+modal_h+"px; box-shadow: 1px 2px 8px 3px #dddddd; background-color:#ffffff;' >";
				//text
				a += "<div id ='info_text' style='width:"+(modal_w)+"px;height:"+(modal_h - info_block_ok)+"px;vertical-align:middle; display:table-cell;'>";
					a += msg;
				a += "</div>";
				// Button OK
				a += "<div class='render_btn' id ='info_block_ok-info_modal_close' style='line-height:"+info_block_ok+"px;width:"+(modal_w)+"px;height:"+(info_block_ok)+"px;'>";
					a += "<div    id ='info_btn_ok' style='margin-left:"+((modal_w/2)-(info_btn_ok_w/2))+"px;margin-top:"+((info_block_ok/2)-(info_btn_ok_h/2))+"px;line-height:"+info_btn_ok_h+"px;border:1px solid #add7f5;width:"+(info_btn_ok_w)+"px;height:"+(info_btn_ok_h)+"px;'>";
						a += "OK";
					a += "</div>"
				a += "</div>";
			a += "</div>";
			$('body').append(a);

			$("#"+ background_layer_id).animate({opacity: 1,marginLeft: 0, marginTop: 0},{duration: 400, queue:false, complete: function()
			{
			}});
			$("#"+ modal_div_id).animate({opacity: 1, width:modal_w, height:modal_h},{duration: 400, queue:false, complete: function()
			{
			}});
			render_bind("render");
	}
