            //Поддерживаем актуальность включены или выключены менеджеры
            max_data_structure.mgrs[obj.n]["state"] = struct[obj.n]["state"];
            // меняем индикацию красный/зелёный
            if (struct[obj.n]["state"] == "on") { color = "#0f0"; }
