    //возвращает массив-пересечение входных массивов
    function IntersecArrays(A,B)
    {
        var m = A.length, n = B.length, c = 0, C = [];
        for (var i = 0; i < m; i++)
        {
            var j = 0, k = 0;
            while (B[j] !== A[ i ] && j < n) j++;
            while (C[k] !== A[ i ] && k < c) k++;
            if (j != n && k == c) C[c++] = A[ i ];
        }
        return C;
    }

    function mumo_client_monitor(event, structure)
    {
        let inner_extract_ids_array =function(structure){
            let ids_arr = structure.row_data.row_id_lookup;
            let result = [];
            let row_type = "";
            //row_max_position_data-2-id_539 -> Если page_type == 0
            //row_render_position_data-1-id_310 -> Если page_type == 1
            if      (max_data_structure.page_type == 0) { row_type = "max"; }
            else if (max_data_structure.page_type == 1) { row_type = "render"; }
            for (let i=1; i < ids_arr.length; i++) {
                let temp_arr = ids_arr[i].split("_");
                // temp_arr[1] == "rar" || "render"
                if ( temp_arr[1] == row_type ){
                    // temp_arr[4] == "539" || "310" || ...
                    result.push(Number(temp_arr[4]));
                }
            }
            return result;
        }
        
        switch (event){
            case "connect":
                max_web_socket.emit("mumo_subscribe_new");
                break;
                
            case "disconnect":
                max_web_socket.emit("mumo_unsubscribe");
                break;
                
            //будет срабатывать при отрисовке главной страницы или страницы одного .max-файла
            case "user_upload_rar":
                break;
            case "lmmk3_processor":
                //console.log(structure.row_data.row_id_lookup);
                //здесь хранится на какой странице пользователь в данный момент
                let page_type = max_data_structure.page_type;
                //Вернет массив типа [505, 510] или пустой []
                let cur_ids = inner_extract_ids_array(structure);
                if ( cur_ids.length > 0 ) { 
                    /*Т.е. здесь может массив ID max-файлов[501,505] или работ[311,320] */
                    max_web_socket.emit("mumo_subscribe_next",{page_type: page_type, cur_ids: cur_ids}); 
                }
                break;
                
            default:
                break;
        }
    
    }


