	function update_progress(step,count_step)
	{
		max_data_structure.progress.step = step;
		max_data_structure.progress.count_step = count_step;

		let t = $("#header_message_box");
		let progress = $("#progress");
		let percent =  $("#percent");
		var progress_max_w = Math.floor(t.width()-2);
		if (step == count_step)
		{
			max_data_structure.progress.step = step;
			progress.width(progress_max_w);
			percent.empty().append("100%");
		}
		else
		{
			if (step <=count_step)
			{
				var percentLoaded = Math.round(100 /(count_step / step) );
				let progress_w = ((progress_max_w/100)*percentLoaded);
				progress.width(progress_w);
				percent.empty().append(percentLoaded + "%");
			}
		}
	}
