	function rar_prm_send_file(file,n_step, file_renamed)
	{
        console.log("rar_prm_send_file()");
        //file = {name: "Teapot_on_2.rar", lastModified: 1568791321161, size: 91767, . . .}
		return new Promise(function(resolve,reject)
		{
            let cur_fname;
            if (typeof file_renamed !== "undefined") {cur_fname = file_renamed}
            else {cur_fname = file}
			//Посылает серверу 'upload_rar' и ждёт "uploading_allowed"
			rar_prm_file_header(cur_fname.name,file.size).then(()=>
			{
                console.log("rar_prm_file_header() OK!");
				max_web_socket.once("uploading_abort", function(msg)
				{
					change_message_info(msg);
					draw_hello_message();
					modal_info_constructor(msg);
					reject("abort");
				});
				max_web_socket.once("uploading_success", function()
				{
					change_message_info("Uploading completed. Unrar...");
					resolve("ok");
				});
				var count_read  = Math.floor(file.size/MAX_TRANSMIT_SIZE);
				var step = n_step;
				
				var reader = new FileReader();
				reader.onloadend = function(evt)
				{
                    console.log("reader.onloadend");
                    console.log(evt.target.readyState == FileReader.DONE);
					if(evt.target.readyState == FileReader.DONE)
					{
                        console.log("evt.target.readyState");
						step ++;
						//max_web_socket.emit("upload_data", evt.target.result);
						max_web_socket.emit("upload_data_2",[cur_fname, evt.target.result]);
                        // Ждёт одноразового события 'transmit_blob_ok' от сервера
						rar_prm_file_bloob().then(() =>
						{
							update_progress(step,count_read);
							if(file.size > MAX_TRANSMIT_SIZE)
							{
								if(step < count_read)
								{
									var start_byte = (step*MAX_TRANSMIT_SIZE);
									var end_byte = start_byte + MAX_TRANSMIT_SIZE ;
									reader.readAsArrayBuffer(rar_make_blob(file,start_byte,end_byte));
								}
								if(step == count_read)
								{
									if(count_read == (file.size/MAX_TRANSMIT_SIZE))
									{
                                        console.log("max_web_socket.emit('end_file_data') 1");
										max_web_socket.emit("end_file_data");
									}
									else
									{
										var start_byte = (step*MAX_TRANSMIT_SIZE);
										var end_byte = file.size ;
										reader.readAsArrayBuffer(rar_make_blob(file,start_byte,end_byte));
									}
								}
								if(step > count_read)
								{
                                    console.log("max_web_socket.emit('end_file_data') 2");
									max_web_socket.emit("end_file_data");
								}
							}
							else
							{
								max_web_socket.emit("end_file_data");
							}
						})
                        .catch((e) => {	reject(e);	});
					}
				};
				
				if (file.size < MAX_TRANSMIT_SIZE)
				{
                    console.log("reader.readAsArrayBuffer 1");
					reader.readAsArrayBuffer(rar_make_blob(file,0,file.size));
				}
				else
				{
					reader.readAsArrayBuffer(rar_make_blob(file,0,MAX_TRANSMIT_SIZE));
                    console.log("reader.readAsArrayBuffer 2");
				}
			})
            .catch((e) =>	{
                reject(e);
            });
		});
	}
