	function rar_prm_file_bloob()
	{
		return new Promise((resolve,reject) =>
		{
			max_web_socket.once("transmit_blob_ok",s_event_transmit_blob_ok);
			max_web_socket.once("transmit_blob_error",s_event_transmit_blob_error);
			
			//=============socket events functions==========
			function s_event_transmit_blob_ok(msg)
			{
				max_web_socket.off("transmit_blob_error",s_event_transmit_blob_error);
				resolve("transmit_blob_ok");
			}
			
			function s_event_transmit_blob_error(msg)
			{
				change_message_info("ERROR TRANSMIT");
				modal_info_constructor(msg);
				draw_hello_message();
				max_web_socket.off("transmit_blob_ok",s_event_transmit_blob_ok);
				reject("transmit_blob_error");
			}
		});
	}
	
	function rar_prm_file_header(fname,fsize)
	{
		return new Promise((resolve,reject) =>
		{
			//max_web_socket.emit("upload_rar",[fname,fsize]);
			max_web_socket.emit("upload_rar_2",[fname,fsize]);
			
			max_web_socket.once("uploading_allowed",s_event_uploading_allowed);
			max_web_socket.once("upload_not_allowed",s_event_upload_not_allowed);
			
			//=============socket events functions==========
			function s_event_uploading_allowed(msg)
			{
				max_web_socket.off("upload_not_allowed",s_event_upload_not_allowed);
				resolve("promise upload header allowed");
				
			}
			
			function s_event_upload_not_allowed(msg)
			{
                console.log("upload_not_allowed EVENT!");
				change_message_info(msg);
				modal_info_constructor(msg);
				max_web_socket.off("uploading_allowed",s_event_uploading_allowed);
				reject("promise upload header NOT allowed");
			}
		});
	}
	
	function rar_make_blob(file,start,end)
	{
        //console.log("rar_make_blob()");
		if (file.webkitSlice) 
		{
			var blob = file.webkitSlice(start, end);
		} else if (file.mozSlice)
		{
			var blob = file.mozSlice(start, end);
		}
		else 
		{
			var blob = file.slice(start, end);
		}
		return blob;
	}


