	function max_bytes_to_size(bytes) 
	{ 
		let sizes = ['Bytes', 'KB', 'MB', 'GB', 'TB']; 
		if (bytes == 0) return '0 Byte'; 
		let i = parseInt(Math.floor(Math.log(bytes)/Math.log(1024))); 
		return Math.round(bytes/Math.pow(1024, i), 2) + ' ' + sizes[i]; 
	}; 
	
	function max_get_full_date(timestamp)
	{
		let date_upload = new Date(timestamp);
		let full_date = date_upload.getFullYear() + "/" + (date_upload.getMonth() + 1) + "/" + date_upload.getDate();
		return full_date;
	}








